#!/usr/bin/env node --expose_gc
'use strict';
var comparator = require('../../');

// roop count
// sampling times
var times = 100000;
var x = 9;
var y = 10;
var nativeMin = Math.min;
var funcs = {
  'Math.min': function() {
    Math.min(x, y) ;
  },
  'Math.min2': function() {
    Math.min(y, x);
  },
  'x<y': function() {
    x < y ? x : y;
  },
  'x>y': function() {
    x > y ? y : x;
  },
  'nativeMin': function() {
    nativeMin(x, y);
  },
  'nativeMin2': function() {
    nativeMin(y, x);
  }
};

var res = comparator
.set(funcs)
.times(times)
.start()
.result();

console.log(res);

